Help #rstats: I do this sort of tidy-eval thing (!!sym() to specify col names with char vectors) all the time in my funcs. Is there a way to improve upon this using the new {{...}} syntax?

library(tidyverse)
func &lt;- function(v) mtcars %&gt;% mutate(x = !!sym(v)*100)
func("mpg")

